import React from 'react';

const Signup = () => {

  const style = {
    margin : "20px"
  }

  const label = {
    border : "1px solid black",
    display : "inline"
  }

  return (
    <div style={style}>
      <div>
        <h1>회원가입</h1>
      </div>
      <hr />
      <div style={label}>
        <span>Member Type</span>
      </div>
    </div>

  );
};

export default Signup;
